import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import {Form, Input, Checkbox, Button } from 'antd';

const Signup = () =>{
    const[id, setId] = useState();
    const[nickName, setNickName] = useState();
    const[password, setPassword] = useState();
    const[passwordConfirm, setPasswordConfirm] = useState();
    const[genter, setGender] = useState();
    const[birth, setBirth] = useState();
    const[tirm, setTerm] = useState(); 

    const onSubmit=()=>{};

    const onChageId=()=>{};
    const onChageNickName=()=>{};
    const onChagePassword=()=>{};
    const onChagePasswordConfirm=()=>{};
    const onChageGender=()=>{};
    const onChageBirth=()=>{};
    const onChageTerm=()=>{}; 


    return (
        <> 
        <AppLayout> 
            <h2>회원가입</h2>
            <Form onSubmit={onSubmit}>
                <ul>
                    <li>
                        <label htmlFor="user-id">아이디</label>
                        <Input name="" require onChange={onChageId} />
                    </li>
                    <li>
                        <label htmlFor="nick-name">닉네임</label>
                        <Input name="" require onChange={onChageNickName} />
                    </li>
                    <li>
                        <label htmlFor="password">비밀번호</label>
                        <Input name="password" require onChange={onChagePassword} />
                    </li>
                    <li>
                        <label htmlFor="password-confirm">비밀번호 확인</label>
                        <Input name="password-confirm" require onChange={onChagePasswordConfirm} />
                    </li>
                    <li>
                        <label htmlFor="gender">성별</label>
                        <Input name="gender" require onChange={onChageGender} />
                    </li>
                    <li>
                        <label htmlFor="birth">생년월일</label>
                        <Input name="birth" require onChange={onChageBirth} />
                    </li>
                    <li>
                        <label htmlFor="user-term">약관동의</label>
                        <Checkbox name="user-term" require  onChange={onChageTerm} >
                            약관에 동의합니다.
                        </Checkbox>
                    </li>
                    <li>
                        <Button type="primary" htmlType="submit">확인</Button>
                    </li>
                </ul>
            </Form>
        </AppLayout>
        </>
    );
}

export default Signup;
